angular.module('starter.controllers', [])

.controller('DashCtrl', function($scope) {

    $scope.imageBase64 = "data:image/png;base64,";
    $scope.imageBase64JPEG = "data:image/jpg;base64,"

    $scope.imageBase64JPEG2 = "data:image/jpeg;base64,";




    $scope.name = "";
    $scope.imageUrlPath ="img/keensoft.png";
    $scope.imageUrlPathJPEG ="img/keensoft.jpg";

    $scope.openImageB64 = function(url, name){
      window.FullScreenImage.showImageBase64(url,name);

    }

    $scope.openImageUrl = function(url){
      window.FullScreenImage.showImageURL(url);

    }

  })

.controller('AccountCtrl', function($scope) {
  $scope.settings = {
    enableFriends: true
  };
});
